import "./App.css";
import Movies from "./components/Movies";
import Count from "./components/Count";
import News from "./components/News";
import Todos from "./components/Todos";

export default function App() {
  return (
    <div className="App">
      <ul>
        <li>
          <Link to="/">Home</Link>
        </li>
        <li>
          <Link to="/movie">Movies</Link>
        </li>
        <li>
          <Link to="/">Count</Link>
        </li>
        <li>
          <Link to="/">News</Link>
        </li>
        <li>
          <Link to="/">Todos</Link>
        </li>
      </ul>
    </div>
  );
}
